description:
Motel 69 (Los Scandalous, Wicked Pictures / DvdRip / 2015) 

What happens when a sleazy motel owner hides cameras inside the rooms? Exactly what you think! In Motel 69, we acquired footage of hookers, cheaters and staff fucking for our enjoyment. Oh, but it doesn't stop there. We also found footage taken from outside their windows and inside their closets! So the next time you get a room, you might just end up in Motel 69.

Brianna Brown, Jade Nile, Nina Elle, Samantha Rone, Sandra Lubrec

Gonzo, Reality

